(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["static-cooperationAgree-cooperationAgree"],{"242e":function(t,n,e){"use strict";e.r(n);var a=e("cf74"),r=e("f66d");for(var u in r)"default"!==u&&function(t){e.d(n,t,function(){return r[t]})}(u);e("5a82");var i=e("2877"),o=Object(i["a"])(r["default"],a["a"],a["b"],!1,null,"94b4c0f2",null);n["default"]=o.exports},"5a82":function(t,n,e){"use strict";var a=e("6bfc"),r=e.n(a);r.a},"6bfc":function(t,n,e){var a=e("9546");"string"===typeof a&&(a=[[t.i,a,""]]),a.locals&&(t.exports=a.locals);var r=e("4f06").default;r("276deb70",a,!0,{sourceMap:!1,shadowMode:!1})},9546:function(t,n,e){n=t.exports=e("2350")(!1),n.push([t.i,"uni-page-body[data-v-94b4c0f2]{padding:0 %?30?%}",""])},a6eb:function(t,n,e){"use strict";Object.defineProperty(n,"__esModule",{value:!0}),n.default=void 0;var a={data:function(){return{}},methods:{}};n.default=a},cf74:function(t,n,e){"use strict";var a=function(){var t=this,n=t.$createElement,e=t._self._c||n;return e("v-uni-view",[e("v-uni-view",{staticStyle:{"text-align":"center"}},[e("v-uni-text",[t._v("共享经济合作伙伴协议")])],1),t._v("《共享经济合作伙伴协议》（以下简称“本协议”）为云账户（天津）共享经济信息咨询有\n\t限公司（以下简称“云账户”）与您（即本协议项下的个体经营者）签订的合作协议。如果您不\n\t同意本协议的任意内容，请不要勾选或以其他方式确认本协议；您点击勾选或以其他方式确认\n\t本协议，即表示您已充分阅读、理解并同意接受本协议的全部内容。\n\t感谢您选择云账户为您提供共享经济综合服务，云账户将依托综合实力竭诚为您提供规范、\n\t专业的服务。\n\t特别声明：\n\t本协议项下的个体经营者（即您）仅限于从事生产经营活动的个人，如您与企\n\t业客户存在劳动/劳务关系或其他类似劳动人事法律关系或您担任企业客户（含关联\n\t方）的法定代表人、股东、董事、监事等，则您不能承揽云账户为满足该企业客户\n\t的业务需求而发布的任务。\n\t一经发现违反上述规定行为的，云账户有权取消您使用云账户服务的资格，并\n\t有权上报相关国家机关，由相关国家机关根据《中华人民共和国税收征收管理法》\n\t及其他相关法律法规的规定追究责任主体的法律责任。\n\t鉴于：\n\t云账户享有使用共享经济资源平台及服务系统（以下称为“云账户综合服务平台”）的合法\n\t授权，可为您提供共享经济综合服务，主要包括基于您的资质和劳动技能为您匹配适合的生产\n\t经营活动以及核算生产经营收入等。您与云账户依据《中华人民共和国合同法》及相关法律法\n\t规的规定，本着平等、自愿、诚信的原则，在平等互利的基础上友好协商并签署本协议。\n\t第一条定义\n\t除非本协议中另有定义，下列词语应具有以下特定涵义：\n\t1、关联方：指相互间直接或间接持有其中一方的股权总和达到25%或以上的；或者直接或\n\t间接同为第三者所拥有或控制股权达到25%或以上的。如果一方通过中间方对另一方间接持有\n\t股份，只要其对中间方持股比例达到25%以上，则其对另一方的持股比例按照中间方对另一方\n\t的持股比例计算；两个以上具有夫妻、直系血亲、兄弟姐妹以及其他抚养、赡养关系的自然人\n\t共同持股同一企业，在判定关联关系时持股比例合并计算。\n\t云账户锦州-南昌方案\n\t02\n\t2、个体经营者：指自我雇佣、自我管理、自担成本、自负盈亏并通过云账户综合服务平台\n\t从事合法合规生产经营活动的个人。\n\t3、代征：指云账户根据《委托代征协议书》的有关规定，接受云账户主管税务机关的委托，\n\t以云账户主管税务机关的名义向从事生产经营活动的个人征收应缴纳的个人所得税的行为。\n\t4、生产经营收入（税后）：指您从事生产经营活动而取得的税后收入。\n\t5、服务费：指由云账户向企业客户提供共享经济综合服务，云账户就该等服务向企业客户\n\t收取的费用。\n\t第二条合作内容\n\t1、云账户为满足企业客户的业务需求而通过云账户综合服务平台向适合个体经营者发布任\n\t务，您可根据自身资质和劳动技能选择是否接受前述活动。\n\t2、云账户通过云账户综合服务平台公布活动内容、活动规则等，您可据此查询、接受活动\n\t内容，并承诺在从事生产经营活动过程中遵守前述活动规则、承担相关义务；云账户根据您任\n\t务完成的数量和质效核算、支付您的生产经营收入（税后）。\n\t3、您委托云账户按照有关税收法律法规、政策规定及云账户主管税务机关的要求为您代征\n\t个人所得税税款。\n\t第三条生产经营收入（税后）的结算及支付方式\n\t1、根据云账户与企业客户签署的《共享经济综合服务协议》的约定，云账户基于企业客户\n\t业务需求所对应的活动内容及费用标准向企业客户提供共享经济综合服务并收取服务费。云账\n\t户收到企业客户支付的服务费后，将根据您任务完成的数量和质效核算、支付您的生产经营收\n\t入（税后）。\n\t2、您应自行负担就您取得的生产经营收入需缴纳的各项税款，应云账户要求，您应提供与\n\t个人所得税申报缴纳相关的协助及信息；云账户承诺依法代征个人所得税并确保您取得税后合\n\t法收入。\n\t第四条您的权利与义务\n\t1、您保证签署本协议时具有完全民事权利能力和民事行为能力或系已满十六周岁未满十八\n\t周岁经法定监护人同意的民事主体，并满足所有履行本协议所需的法定条件或约定条件，保证\n\t在从事生产经营活动时，遵照相关活动规则并自备所需要的设备设施、自行承担必要费用，如\n\t因您个人原因造成您本人或任意第三方损害的，由您承担全部法律责任。\n\t2、您保证具有从事云账户发布的生产经营活动的资质和劳动技能。如果您所从事的生产经\n\t云账户锦州-南昌方案\n\t03\n\t营活动需经相关国家机关许可或以其他方式进行的，您应先行取得相关许可并按照法律规定的\n\t方式从事生产经营活动，否则您应自行承担全部法律后果，并赔偿由此给云账户造成的全部损\n\t失。\n\t3、您有权在云账户处查询生产经营收入（税后）的核算方式、取得生产经营收入（税后）。\n\t您保证所从事的生产经营活动是以您个人名义进行的，与您名下的个体工商户（如有）没有任\n\t何关系；您保证不以云账户的名义从事任何与本协议项下的生产经营活动无关的业务。\n\t4、您保证在生产经营活动过程中遵守国家法律法规，不得从事违反法律或行政法规等行为\n\t（包括但不限于涉嫌传销、赌博、暴力、淫秽、恐怖行为、洗钱、偷税、漏税、逃税）及其他\n\t不得使用云账户服务的行为，云账户主管税务机关或/及其他相关国家机关介入调查时，您应当\n\t予以协助并如实反映情况，不得阻挠、拒绝调查。\n\t5、您充分理解个体经营者的定义，并承诺不存在下列所述情形：\n\t5.1承揽的生产经营活动系云账户为满足与您存在劳动/劳务关系或其他类似的劳动人事法律\n\t关系的企业客户的业务需求而发布的；\n\t5.2承揽的生产经营活动系云账户为满足由您担任法定代表人、股东、董事、监事等的企业\n\t客户（含关联方）的业务需求而发布的；\n\t5.3其他不适用于云账户服务范围之规定的人员。\n\t6、您保证向云账户提供的信息均是真实的、有效的、合法的，如信息发生变更（例如，不\n\t再是个体经营者身份时）应及时通知云账户，否则因此造成的一切不利后果由您承担。您的账\n\t户信息以您实名提交至云账户综合服务平台后台的信息为准，且您保证该账户为纳税义务人\n\t（即您本人）所有。自云账户将应支付的生产经营收入（税后）支付至您的账户之日起，视为\n\t您收到前述费用。如因您提供信息有误等导致付款失败的，您独自承担相应责任。您承诺使用\n\t前述账户的行为符合中华人民共和国法律的规定，如果云账户收到云账户主管税务机关或/及其\n\t他相关国家机关任何调查请求的，您应提供协助并如实反映情况。\n\t7、您须谨慎保管于云账户处注册时所使用的相关信息（包括但不限于账户信息、身份凭\n\t证），因您泄露或提供给他人使用该等信息而造成的不利后果，由您自行承担。您应根据相关\n\t法律法规或政策积极办理“个体经营者”市场主体的身份登记事宜，可由云账户提供便利。\n\t8、您同意并授权云账户为实现本协议合作目的收集、留存并合法使用您的个人信息（包括\n\t但不限于您的姓名、身份证号、收款账户信息、活动内容及费用），如云账户收集、存储或使\n\t用的您的个人信息有错误的，您有权要求予以更正；如云账户违反法律、行政法规的规定或者\n\t双方的约定收集、使用您的个人信息的，您有权要求予以删除。\n\t9、为准确无误地向您支付生产经营收入（税后），您同意并授权云账户将您的姓名、身份\n\t证号、收款账户信息及联系方式共享给云账户的合作机构进行信息核验，云账户将采用加密措\n\t云账户锦州-南昌方案\n\t04\n\t施保证您的前述个人信息不被泄露。\n\t10、您应当本着云账户利益最大化的原则，勤勉履行本协议，维护云账户形象，不得损害\n\t云账户的合法权益。\n\t第五条云账户的权利与义务\n\t1、基于企业客户的业务需求及您的资质和劳动技能，云账户有权就您从事的生产经营活动\n\t制定相应的活动标准，云账户应敦促您遵守前述活动标准并不得违背相关法律法规和前述活动\n\t标准，但该等敦促为平等主体之间为实现合同目的的敦促，适用《中华人民共和国合同法》约\n\t束，且不导致云账户与您之间构成劳动/劳务关系。\n\t2、在企业客户及时、足额向云账户支付服务费的情况下，您发起的生产经营收入的提现或\n\t支付申请，由云账户根据您任务完成的数量和质效核算、支付您的生产经营收入（税后）（您\n\t从事的生产经营活动超出云账户发布任务的除外）。\n\t3、云账户有权根据相关法律法规或政策，推进您“个体经营者”市场主体的身份登记事宜\n\t并积极提供便利。\n\t4、云账户在向您支付生产经营收入（税后）时，有权在云账户所在地向云账户主管税务机\n\t关代您进行临时税务登记，并按照有关税收政策规定及云账户主管税务机关的要求，向您代征\n\t个人所得税税款。\n\t5、云账户发现您违反本协议第四条第5款之约定的，有权立即中止履行本协议，并向云账\n\t户主管税务机关报告，您应自行承担由此产生的税务相关的处罚责任（包括但不限于根据云账\n\t户主管税务机关的要求补缴相应的税款、滞纳金、罚金）。\n\t6、云账户有权留存并合法使用为实现本协议合作目的从您处获取的您的个人信息，云账户\n\t（含股东会、董事会、监事会成员及高级管理人员）承诺对您所披露的个人信息进行保密，未\n\t经您授权或基于合法并可执行的法律、法规、法院命令、监管机构的要求或为遵守适用法律法\n\t规、履行网络安全保护义务或应对网络安全事件的需要，云账户（含股东会、董事会、监事会\n\t成员及高级管理人员）不得将您的个人信息披露给任意第三方。云账户承诺按照相关法律法规\n\t的要求对您的个人信息履行安全保护义务，保障网络免受干扰、破坏或未经授权的访问，防止\n\t网络数据泄露或被窃取、篡改。\n\t7、云账户因网络服务的特殊性需短时间中断服务对系统进行维护和升级，您理解并认可前\n\t述行为不属于云账户违约情形。\n\t8、云账户可为您提供养老保险的缴纳等服务，具体服务细则由双方另行约定。\n\t9、云账户应当本着您利益最大化的原则，勤勉履行本协议，不得损害您的合法权益。\n\t云账户锦州-南昌方案\n\t05\n\t第六条违约责任\n\t1、除本协议另有约定外，本协议任意一方不履行或不完全履行本协议约定的义务和承诺即\n\t构成违约。违约方应当负责赔偿其违约行为给守约方造成的一切经济损失（包括但不限于合理\n\t的律师费、诉讼费、公证费）。\n\t2、如您违反相关法律法规或社会公序良俗给云账户造成损失的（包括但不限于经济损失、\n\t商誉或企业形象等损失），云账户有权向您主张损害赔偿。\n\t3、因政府行为（包括但不限于因中国政府机关不授予或调整云账户相应经营资质或权利）\n\t或其他不可抗力因素导致本协议部分条款或全部条款无法履行的，遭受该行为的一方不承担违\n\t约责任。\n\t第七条保密责任\n\t1、本协议任意一方应对本协议所涉及的所有内容以及协议双方在执行本协议过程中相关的\n\t法律、商业、合作业务的所有信息进行保密。未经对方允许，均不得向任意第三方披露。\n\t2、保密期限应为：自协议生效之日起至协议终止后十年。\n\t第八条适用法律、争议及纠纷解决和司法管辖\n\t本协议的订立、执行、解释和争议的解决均应适用中华人民共和国境内法律。凡因本协议\n\t引起的或与本协议有关的任何争议，协议双方应友好协商解决。如不能协商解决，双方一致同\n\t意提交至被告所在地有管辖权的人民法院诉讼解决。\n\t第九条通知\n\t1、有效联系方式\n\t云账户有权通过您在微信小程序或云账户其他平台中的注册信息或企业客户等方式收集您\n\t的联系地址、电子邮箱、联系电话等信息，如您的联系方式发生变更，您有义务及时更新有关\n\t信息，并保持可被联系的状态。\n\t如您注册了微信小程序或云账户其他平台，您注册生成的账号，也作为您的有效联系方式。\n\t云账户将通过上述联系方式的其中之一或其中若干向您送达各类通知，而此类通知的内容\n\t可能对您的权利义务产生重大的有利或不利影响，请您务必及时关注。\n\t2、通知的送达\n\t云账户通过上述联系方式向您发出通知，其中以电子方式发出的书面通知，包括但不限于\n\t在微信小程序或云账户其他平台发布公告、向您的联系电话发送手机短信、向您的电子邮箱发\n\t云账户锦州-南昌方案\n\t06\n\t送电子邮件、向您的账号发送平台通知及通过在线客服向您发送通知，通知在发送成功后即视\n\t为送达。\n\t您可以通过您预留的电子邮箱、云账户平台的在线客服、服务热线（4006565739）等方式\n\t向云账户发出通知，您通过前述联系方式发出的通知视为您本人的意思表示，在发送成功后即\n\t视为送达；您以纸质载体发出的书面通知，按照云账户联系地址交邮后的第五个自然日即视为\n\t送达。\n\t第十条协议的变更与终止\n\t1、云账户有权根据需要不定期更新本协议条款，并在企业客户APP、小程序或以其他方式\n\t予以公布。如您同意所修改的内容，请点击勾选或以其他方式确认继续使用云账户服务；如您\n\t不同意所修改的内容，请立即停止使用云账户服务。\n\t2、如发生以下任一情形，您有权以本协议第九条的所列的方式通知云账户终止本协议：\n\t2.1云账户破产或被取消营业资格的；\n\t2.2本协议更新后，您不同意所修改内容并停止使用云账户服务的；\n\t2.3您不愿继续使用云账户服务的。\n\t3、您应遵守本协议约定、相关法律法规的规定及社会公序良俗，云账户有权自主判断您的\n\t行为是否违约或/及违规。发生下列情形时，云账户有权在不事先通知的情况下，限制或停止您\n\t使用云账户服务的资格，情形严重的，云账户有权以本协议第九条所列的方式通知您终止本协\n\t议：\n\t3.1如云账户有合理理由或有证据认定您违反本协议约定、相关法律法规或社会公序良俗的\n\t（包括但不限于涉嫌传销、赌博、暴力、淫秽、恐怖行为、洗钱、偷税、漏税、逃税）；\n\t3.2如云账户有合理理由或有证据认定您存在危害国家统一、颠覆国家政权、损害国家荣誉\n\t和利益、破坏民族团结的行为或发表前述相关言论的；\n\t3.3您违反云账户的活动规则等，且在云账户警告后3个工作日内仍未改正的；\n\t3.4云账户按照法律规定或有权机关的要求终止向您提供服务的；\n\t3.5其他原因导致本协议无法继续履行的。")],1)},r=[];e.d(n,"a",function(){return a}),e.d(n,"b",function(){return r})},f66d:function(t,n,e){"use strict";e.r(n);var a=e("a6eb"),r=e.n(a);for(var u in a)"default"!==u&&function(t){e.d(n,t,function(){return a[t]})}(u);n["default"]=r.a}}]);